import React,{useEffect,useState} from 'react';
import './Home.css';
import AOS from 'aos';
import 'aos/dist/aos.css';

const Home = () => {
  useEffect(() => {
    AOS.init({
      duration: 1000, // Set the duration of the animation
      offset: 100,
      once: false, // Only animate once
    });
  }, []);
  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };
  const images = [
    '/images/TRUCK.png', 
    '/images/CHARGER.png', 
  ];

  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  const handleNextImage = () => {
    setCurrentImageIndex((prevIndex) => (prevIndex + 1) % images.length);
  };

  const handlePrevImage = () => {
    setCurrentImageIndex((prevIndex) => (prevIndex - 1 + images.length) % images.length);
  };

  return (
    <div>
      {/* home page */}
      <section id="home" className="home-section">
        <div className="w3-content w3-display-container">
            {images.map((image, index) => (
              <img
                key={index}
                className={`mySlides fade ${index === currentImageIndex ? 'visible' : 'hidden'}`}
                src={image}
                alt={`Image ${index + 1}`}
              />
            ))}
            <button className="prev" onClick={handlePrevImage}>&#10094;</button>
            <button className="next" onClick={handleNextImage}>&#10095;</button>
            <div className="w3-center w3-display-bottommiddle" style={{ width: '100%' }}>
              {images.map((_, index) => (
                <span
                  key={index}
                  className={`w3-badge demo w3-border ${index === currentImageIndex ? 'active' : ''}`}
                  onClick={() => setCurrentImageIndex(index)}
                ></span>
              ))}
            </div>
          </div>
      </section>
      <div className="section-divider"></div>
    {/* about page */}
      <section id="about" >
        <div className="about-content" data-aos="fade-up">
          <h2>Mittal Food</h2>
          <h4>
          Mittal Food stands as a preeminent manufacturing powerhouse specializing 
          in the production of premium-quality dough sheets in India. 
          Our corporate headquarters is strategically located in the vibrant town of Pardi, nestled within the picturesque District of Valsad in Gujarat. Leveraging a wealth of industry expertise, we take immense pride in our 15-year legacy, during which we have consistently demonstrated a commitment to excellence in both dough sheet manufacturing and overall product quality.At Mittal Food, we understand that quality is paramount. Our commitment to delivering unparalleled excellence is reflected in every facet of our manufacturing process. From sourcing premium raw materials to employing rigorous quality control measures, we leave no stone unturned in ensuring that our dough sheets meet and exceed the highest industry standards.

          </h4>

        </div>

      </section>

      <div className="section-divider"></div>

      {/* contact page */}
      <section id="contact">
      <div className="contact-container">
      <div className="contact-text">
        <h2>We are at your service. Contact us now!</h2>
        <h3>We love our customers, so feel free to contact us during normal business hours.</h3>
        <a href="https://wa.me/9824125433" className="whatsapp-button">Message us on WhatsApp</a>
      </div>

      <div className="working-hours">
        <h3>Working Hours:</h3>
        <ul>
          <li><strong>Monday:</strong> 9 AM - 6 PM</li>
          <li><strong>Tuesday:</strong> 9 AM - 6 PM</li>
          <li><strong>Wednesday:</strong> 9 AM - 6 PM</li>
          <li><strong>Thursday:</strong> 9 AM - 6 PM</li>
          <li><strong>Friday:</strong> 9 AM - 6 PM</li>
          <li><strong>Saturday:</strong> 10 AM - 4 PM</li>
          <li><strong>Sunday:</strong> Closed</li>
        </ul>
      </div>
    </div>
      </section>
      {/* products page */}
      <section id="products" >


      </section>
      <div className="section-divider"></div>
    {/* values page */}
      <section id="values" >

      </section>
      <div className="section-divider"></div>



    </div>
  );
};

export default Home;
